import { Card , Avatar} from 'antd';

const UserProfile = () => { 
  return (
    <>
      <Card></Card>
      <Card.Meta
        avatar={<Avatar>SECHO</Avatar>}
        title="secho"
        />
    </>
    
  );
}

export default UserProfile;
